import React from 'react';

function Orders() {
  const orders = [
    { id: 101, item: "Aloe Vera", total: "$25" },
    { id: 102, item: "Snake Plant", total: "$40" },
    { id: 103, item: "Peace Lily", total: "$35" },
  ];

  return (
    <div className="container mt-5">
      <h3 className="text-center text-success mb-4">Your Orders</h3>
      <ul className="list-group">
        {orders.map(order => (
          <li key={order.id} className="list-group-item">
            <strong>Order #{order.id}</strong>: {order.item} - {order.total}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Orders;
